    const loginStatus = () => {
        const token = localStorage.getItem("jwt")
        
    }
    loginStatus();

    return (
        <div className="navbar">
            <img src={logo} alt="" />
            <ul className="nav-menu">
                <Link to="/signup">
                    <li>SignUp</li>
                </Link>
                <Link to="/signin">
                    <li>SignIn</li>
                </Link>
                <Link to="/profile">
                    <li>Profile</li>
                </Link>
                <Link to ="/createPost">Create Post</Link>
            
        </ul>
    </div>
    );
}
